"93484":{"id":"93484","name":"O Legado de Júpiter","slug":"o-legado-de-jupiter","original_title":"Jupiter's Legacy","overview":"A primeira geração desses super-heróis manteve o mundo seguro por quase um século. Mas será que seus filhos vão conseguir carregar esse legado?","first_air_date":"2021-05-07","episode_run_time":45,"vote_average":6.969,"number_of_seasons":1,"number_of_episodes":8,"created_by":["Steven S. DeKnight"],"production_companies":["di Bonaventura Pictures","DeKnight Productions","Millarworld"],"genres":["Sci-Fi & Fantasy","Action & Adventure","Drama","Mistério"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/braALW3UODI3aUV3wfrXpvvVzBl.jpg","poster_path":"https://image.tmdb.org/t/p/original/1RFKW55GHQShX07TdXFHvGFjZKI.jpg","cast":["Josh Duhamel","Ben Daniels","Leslie Bibb","Andrew Horton","Elena Kampouris"],"trailer":"78QltZcT7Ws","seasons":{"1":{"name":"Volume 1","poster_path":"https://image.tmdb.org/t/p/original/gSFDXb6IMXDSdw4avtzCVWouIfk.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/gSFDXb6IMXDSdw4avtzCVWouIfk.jpg","air_date":"2021-05-07","episode_count":8,"overview":"N/A","vote_average":6.6,"episodes":{"1":{"name":"Pela luz do amanhecer","overview":"Brandon não consegue corresponder às expectativas do pai. Em 1929, a vida despreocupada de Sheldon como filho de pai rico sofre um baque.","air_date":"2021-05-07","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/fkLyxnI9pKsfUoABbrb5z8xtmJJ.jpg","vote_average":6.3},"2":{"name":"Papel e pedra","overview":"Brandon e Chloe enfrentam o pai depois do incidente com o Estrela Negra. Sheldon confronta uma repórter que publicou uma matéria explosiva.","air_date":"2021-05-07","runtime":35,"still_path":"https://image.tmdb.org/t/p/original/7mp86HhN05qFj1FJ6EhMUJwjzqR.jpg","vote_average":6.7},"3":{"name":"Pintando as nuvens com a luz do sol","overview":"Preocupado com o comportamento estranho de Sheldon, George resolve visitá-lo. Um roubo dá errado, e Hutch acaba tendo problemas com um chefão com superpoderes.","air_date":"2021-05-07","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/miskGgAVDWk3bfl6049OTcH4yyk.jpg","vote_average":6.6},"4":{"name":"Todos os demônios","overview":"Chloe está fora de controle e cada vez mais perto do fundo do poço. Sheldon não consegue encontrar respostas para as visões que o atormentam.","air_date":"2021-05-07","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/zDiSZSb7Mq2oMJBEEXIqTzQtH9Y.jpg","vote_average":6.6},"5":{"name":"De que adianta?","overview":"Sheldon tenta reunir o time dos sonhos para ir com ele rumo ao desconhecido. Uma autópsia revela um objeto misterioso ligado a alguém que Chloe acabou de conhecer.","air_date":"2021-05-07","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/daLuedUIJKNmQBjXBccU46XF1Do.jpg","vote_average":6.8},"6":{"name":"Cubram o rosto dela","overview":"Grace vê pessoalmente como o Código está afetando a nova geração de super-heróis. No navio, Sheldon insiste em seguir adiante com a expedição e as tensões aumentam.","air_date":"2021-05-07","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/eFVODVGmnV9f4z3PkZHdjoBPhNM.jpg","vote_average":6.3},"7":{"name":"Omnes pro uno","overview":"Na última parte da viagem, a equipe de Sheldon chega ao limite. Em busca de informações, Walter recorre a uma fonte controversa.","air_date":"2021-05-07","runtime":56,"still_path":"https://image.tmdb.org/t/p/original/bN4kx98cYf8tI8sClq6evnCMcEf.jpg","vote_average":6.9},"8":{"name":"Como tudo termina","overview":"A situação de Walter piora. Sheldon e Brandon unem forças em um confronto de vida ou morte com um supervilão. Hutch se mete em apuros durante um roubo.","air_date":"2021-05-07","runtime":36,"still_path":"https://image.tmdb.org/t/p/original/nsyd0XggnfX0STjJTTxth7zk6hk.jpg","vote_average":6.7}}}}},
