"112671":{"id":"112671","name":"A Matilha","slug":"a-matilha","original_title":"The Pack","overview":"Nesta aventura global, 12 duplas de cães e seus companheiros humanos competem em provas divertidas comemorando seu incrível vínculo. No final desta jornada inesquecível há um prêmio de US$ 500 mil para a dupla vencedora e US$ 250 mil para uma instituição de caridade canina. A Matilha é apresentada pela medalhista olímpica Lindsey Vonn e sua cachorra Lucy.","first_air_date":"2020-11-20","episode_run_time":50,"vote_average":6.1,"number_of_seasons":1,"number_of_episodes":10,"created_by":[],"production_companies":[],"genres":["Reality"],"certification":"12","backdrop_path":"https://image.tmdb.org/t/p/original/pVjmreE4kJ5JBYiUZXKeW3faA9F.jpg","poster_path":"https://image.tmdb.org/t/p/original/fZLoRskG5JO8d2NGyy4DTrivX82.jpg","cast":["Lindsey Vonn"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/fZLoRskG5JO8d2NGyy4DTrivX82.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/fZLoRskG5JO8d2NGyy4DTrivX82.jpg","air_date":"2020-11-20","episode_count":10,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Los Angeles","overview":"Doze cães e seus parceiros humanos embarcam em uma jornada especial ao redor do mundo. Começando em Los Angeles, as doze duplas são divididas em duas matilhas. Eles vão competir em provas em um estúdio e em dois navios majestosos enquanto se divertem. Uma matilha competirá entre si em uma prova eliminatória e uma dupla cão/parceiro será mandada para casa.","air_date":"2020-11-20","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/pvEzY6u8RMMv6P6NzCsA6fbaOM8.jpg","vote_average":0},"2":{"name":"Cidade do México","overview":"Onze duplas embarcam em sua primeira experiência internacional e vão para a Cidade do México. Dois cães se apaixonam, enquanto as matilhas aprendem a trabalhar juntas para superar as barreiras do idioma e novos arredores. Eles vão descobrir o esporte do país jogando futebol e vivenciar a cultura do \"Dia dos Mortos\" e participar em um treino de resgate de terremoto para continuar na competição.","air_date":"2020-11-20","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/jtl5fCu4S02YQuJtWE9NhtlaU1b.jpg","vote_average":0},"3":{"name":"Costa Rica","overview":"Dez duplas cão/parceiro permanecem enquanto A Matilha vai para a selva da Costa Rica. Com a glória da natureza, as matilhas experimentam \"pura vida\" com provas repletas de adrenalina, emoção e aventura. As equipes enfrentarão medos, se divertirão e serão lembradas do que vieram fazer. Uma dupla será eliminada e sua jornada terminará.","air_date":"2020-11-20","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/iOyq50cKfA5TVBnoq8obNb2oJUO.jpg","vote_average":0},"4":{"name":"Costa Rica - 2ª Parte","overview":"Nove cães e seus parceiros continuam na competição. Sua experiência costa-riquenha continua e as matilhas saem das praias e vão para a cidade de San José. Com a competição esquentando e pontos fortes e fraquezas começando a aparecer, alguns companheiros de matilha mostram-se hábeis competidores e outros têm dificuldade.","air_date":"2020-11-20","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/kIpgUojAUmb71fF1qi3y2i9h4YM.jpg","vote_average":0},"5":{"name":"Viena","overview":"As oito duplas remanescentes vão para Viena, Áustria. Para evitar a eliminação, uma matilha deixará uma marca musical indelével na cidade famosa e outra seguirá as tradições de cães de caça do país. Na prova final, os cães farão truques para conseguir salsichas e isso determinará quem será eliminado.","air_date":"2020-11-20","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/tlj6hwvVJFkPtTLQUWVnl1iHWpN.jpg","vote_average":0},"6":{"name":"Florença","overview":"Sete duplas cão/parceiro continuam e vão para Florença, Itália. As Matilhas têm um jantar italiano com Lindsey e Lucy. Na Prova de Matilha, uma matilha irá \"puxar\" e a outra irá \"buscar\". Na eliminatória, uma matilha colocará o faro à prova para não ser a dupla eliminada.","air_date":"2020-11-20","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/zaPPDIwv62ufkJ3rmbAEIGU1p1l.jpg","vote_average":0},"7":{"name":"Suíça","overview":"As seis duplas restantes chegam ao paraíso invernal das montanhas nevadas da Suíça. Os Alpes Suíços vão tirar seu fôlego, enquanto competem por uma vaga entre os cinco últimos. As matilhas enfrentarão provas com curling, trenó de cães, barris de uísque e resgate de vítimas de avalanche. Seu globo de neve será agitado, e para uma dupla a jornada chegará ao fim.","air_date":"2020-11-20","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/7tciaSbrUtiL7wLvlwt1TTxAYT.jpg","vote_average":0},"8":{"name":"Paris","overview":"Restam cinco duplas quando A Matilha parte para Paris, a cidade das luzes, amor, moda e comida. As matilhas serão imersas na rica cultura parisiense em uma passarela, uma cozinha e nas ruas repletas de cafeterias de Paris. Amizades se formaram entre as cinco duplas e está ficando mais difícil de se despedir, mas, infelizmente, para uma dupla a jornada chegará ao fim.","air_date":"2020-11-20","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/90TsGSDTakkuKLnsv245qbiesn4.jpg","vote_average":0},"9":{"name":"Londres","overview":"As quatro duplas finais chegam a Londres, onde dirigir do lado esquerdo não é a única coisa estranha. Com apenas duas duplas em cada matilha, eles terão uma batalha real e uma surpresa que ninguém esperava. Após uma mudança na Prova de Matilha, somente uma dupla está livre de ser eliminada.","air_date":"2020-11-20","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/eH3xSzzyvAoMkIQizHFVmatKk4O.jpg","vote_average":0},"10":{"name":"EUA","overview":"As três duplas finais vão para a fronteira oeste de Utah, onde terão uma última competição épica. Cães e parceiros enfrentarão as provas mais difíceis e todas as suas habilidades serão testadas. De dinossauros e lanchas a escavações em busca de ouro, esta aventura é uma corrida em que apenas uma dupla receberá o prêmio para si e para a instituição de caridade.","air_date":"2020-11-20","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/jBfgJTtCCfbUzjt6mJ6ApuJeibd.jpg","vote_average":0}}}}},
