"100052":{"id":"100052","name":"O Jogo Inglês","slug":"o-jogo-ingles","original_title":"The English Game","overview":"Nos anos 1870, dois jogadores de futebol de classes sociais opostas enfrentam dramas pessoais e profissionais para mudar o esporte (e a Inglaterra) para sempre.","first_air_date":"2020-03-20","episode_run_time":0,"vote_average":7.408,"number_of_seasons":1,"number_of_episodes":6,"created_by":["Julian Fellowes","Oliver Cotton","Tony Charles"],"production_companies":["42"],"genres":["Drama"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/gVj2cKqtI27Z37woGRm7847V8WJ.jpg","poster_path":"https://image.tmdb.org/t/p/original/9otIgduzpwW6vYPb20sTfJgxDtE.jpg","cast":["Kevin Guthrie","Edward Holcroft","Niamh Walsh","Charlotte Hope","Craig Parkinson"],"trailer":"-lvwkRWTjT8","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/i12l5KX3c1q0UmMJ6CfNHy9yrqP.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/i12l5KX3c1q0UmMJ6CfNHy9yrqP.jpg","air_date":"2020-03-20","episode_count":6,"overview":"Nos anos 1870, dois jogadores de futebol de classes sociais opostas enfrentam dramas pessoais e profissionais para mudar o esporte (e a Inglaterra) para sempre.","vote_average":7.4,"episodes":{"1":{"name":"Episódio 1","overview":"Na esperança de disputar o título da Copa da Inglaterra, o proprietário de uma fábrica contrata dois craques escoceses como reforços para o time local.","air_date":"2020-03-20","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/OuAOiAD7KmvLdq8URJsD4XCHhz.jpg","vote_average":6.3},"2":{"name":"Episódio 2","overview":"Fergus traz nova vida ao clube, mas a situação fica tensa com a diminuição dos salários na fábrica. Arthur recebe uma proposta em Darwen.","air_date":"2020-03-20","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/yIpFqblDmwh3GLsBhOc2NGHU4fx.jpg","vote_average":7.5},"3":{"name":"Episódio 3","overview":"Fergus enfrenta uma decisão difícil que pode afetar sua situação em Darwen. A nova postura de Arthur perturba seus amigos e familiares esnobes.","air_date":"2020-03-20","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/gKqUR2F3cVS9JGxkwI12OvVjwYa.jpg","vote_average":7.5},"4":{"name":"Episódio 4","overview":"Marta recebe más notícias. Arthur e Alma fazem uma descoberta sombria. Fergus enfrenta dificuldades na nova função, e um jogo em Blackburn termina em caos.","air_date":"2020-03-20","runtime":55,"still_path":"https://image.tmdb.org/t/p/original/yjn6Whqy7BYXoTSEGVd8uLZTYYw.jpg","vote_average":7.5},"5":{"name":"Episódio 5","overview":"Fergus recebe notícias chocantes de Marta. Walsh e Cartwright fazem um pacto. A organização da Copa da Inglaterra toma medidas drásticas sem consultar Arthur.","air_date":"2020-03-20","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/89KRfN13kNA04WXIma5K3AncKeu.jpg","vote_average":7.5},"6":{"name":"Episódio 6","overview":"Fergus vai a Londres para recorrer da decisão da organização da Copa. Arthur promete defender os interesses do futebol. A final da Copa da Inglaterra se aproxima.","air_date":"2020-03-20","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/naxdd9dk3WazpEy6DMcF81x2y58.jpg","vote_average":7.5}}}}},
